import React, { Component } from 'react';

class Attending extends Component {
  constructor(props) {
    super(props);
    this.state = {
    };
  }

  render() {
    const existingEvents = this.props.attending.map(event => (
      <span className="attendingTag" value={event}>{event}</span>
    ));

    return (

      <div className="attendingEvents">
        <h2>Attending Events: </h2>
        {existingEvents}
      </div>
    );
  }
}

export default Attending;
